import React from "react";
import "./Collage.css";
import "Invit2.css";

const images = [
  "url-de-imagen-1",
  "url-de-imagen-2",
  "url-de-imagen-3",
  "url-de-imagen-4",
];

const Collage = () => {
  return (
    <div className="collage">
      {images.map((img, index) => (
        <div className="collage-item" key={index} style={{ backgroundImage: `url(${img})` }}></div>
      ))}
    </div>
  );
};

export default Collage;
